function dropDiacritic(word) {
  logger.checkNormalize();
  return toUtf8String(Array.prototype.filter.call(toUtf8Bytes(word.normalize("NFD").toLowerCase()), c => {
    return c >= 65 && c <= 90 || c >= 97 && c <= 123;
  }));
}

function expand(word) {
